from CyclopeptideSequencing import *
from ProteinTranslationProblem import *
import unittest

class cyclopeptides_seuqnencing_test(unittest.TestCase):

    def test_number_cyclic_subpeptides(self):
        self.assertEqual(NumberCyclicSubpeptides(31315), 980597910)

    def test_linear_spectrum(self):
        self.assertEqual(LinearSpectrum("NQEL"), [0, 113, 114, 128, 129, 242, 242, 257, 370, 371, 484])

    def test_cyclic_spectrum(self):
        self.assertEqual(CyclicSpectrum("NQEL"), [0, 113, 114, 128, 129, 227, 242, 242, 257, 355, 356, 370, 371, 484])
    
    def test_protein_translation(self):
        self.assertEqual(ProteinTranslation(""), 
                         "")
    
    def test_counting_peptide(self):
        self.assertEqual(CountingPeptides(1024), 14712706211)
    
    def test_number_of_peptides(self):
        self.assertEqual(NumberOfSubpeptides(4), 11)
    
    def test_expand(self):
        self.assertEqual(Expand([""]), ['G','A','S','P','V','T','C','I','N','D','K','E','M','H','F','R','Y','W'])   

if __name__ == "__main__":
    unittest.main()
    pass
